INSERT INTO `huawei-tablet` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Huawei-Tablet/Huawei MateBook E.webp;', 'Huawei MateBook E', 'https://www.amazon.de/HUAWEI-MateBook-Generation-FullView-Gutschein/dp/B09S14P9RR/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3V1EBOEJ2CTB1&keywords=Huawei+MateBook+E&qid=1667647362&qu=eyJxc2MiOiIyLjU1IiwicXNhIjoiMi4yNSIsInFzcCI6IjEuOTYifQ%3D%3D&sprefix=h%2Caps%2C87&sr=8-4', '469,00', 4.0, 25, 0, 'HUAWEI;3;709 g;13 MP;8 MP;Ja;Integriert;Windows 11 Home;2560 x 1600 Pixel;WLAN;12.6 Zoll;8 GB;HUAWEI;42 Wattstunden;2560 x 1600 Pixels;MateBook E;2022;-;Intel;128 GB;802.11n, 802.11ax, 802.11b, 802.11g, 802.11ac;【Farbechtes 12,6" OLED HUAWEI FullView-Display】Das MateBook E kommt mit einem OLED Display mit einer Auflösung von 2560 x 1600 Pixeln,einem P3 Farbspektrum wie im Kino für brillante Darstellung,einem ultrahohen Kontrastverhältnis und einer maximalen Helligkeit von bis zu 600 Nits (400 Nits im normalen Modus). Desweiteren besticht das MateBook E mit seinem ultra schmalen Rand von 5.6 mm und einer Screen-to-Body-Ratio von 90%.|【Von Hause aus vielseitig】Das HUAWEI MateBook E ist ein 2-in-1 Laptop, welcher unter Windows 11 läuft und mit den Intel Core Prozessoren der 11. Generation und der neuen Intel Iris Graphik für ein noch natloseres Büroerlebnis sorgt. Kopplen Sie es mit einer Tastatur, um einen Laptop für maximale Produktivität zu haben|【Werden Sie kreativ mit dem HUAWEI M-Pencil (2. Generation) 】Der HUAWEI M-Pencil ist kompatibel mit dem HUAWEI MateBook E. Der Pencil unterstüzt Screenshots mit einem Doppeltippen, Magnetische Verbindung und kabelloses Laden|【65 W Fast Charging】 Immer voller Energie mit 65 W Ladegerät, lädt in 30 Minuten bis zu 54 %, in 90 Minuten komplett.|【Erstklassiges Audio und Video】 Das HUAWEI MateBook E unterstützt intelligente Geräuschreduzierung mit vier Mikrofonen und Full-HD Kamera. Die vier Lautsprecher werden professionell durch HUAWEI Sound abgestimmt, um kristallklare, ausgewogene Bässe und Höhen zu erzeugen. Damit nichts von Ihrer Stimme ablenkt.|【Nahtlose Verbindung zwischen Geräten】Das HUAWEI MateBook E unterstützt das brandneue Super Device für schnelle, bequeme Smart-Screen-Konnektivität. Das ist ideal für Präsentationen und superschnellen Zugang zu Bildern und Dateien auf Ihrem Smartphone. Erreichen Sie alles extrem schnell|【Lieferumfang】1 x HUAWEI MateBook E 1 x HUAWEI USB Type-C Netzteil 65 W 1 x Ladekabel Typ C Kurzanleitung Garantiekarte/24 Monate Garantie&nbsp;');
INSERT INTO `huawei-tablet` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Huawei-Tablet/Huawei MatePad 10,4 Zoll.webp;', 'Huawei MatePad 10,4 Zoll', 'https://www.amazon.de/HUAWEI-FullView-Tablet-PC-Betriebssystem-Services/dp/B08CHHVWG4/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1H1YJG6HR2FIF&keywords=Huawei+MatePad+10%2C4+Zoll&qid=1667647373&qu=eyJxc2MiOiIxLjU1IiwicXNhIjoiMS4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C92&sr=8-4', '290,42', 4.2, 313, 0, 'HUAWEI;1;450 g;8 MP;8 MP;Ja;Integriert;Android 10;2000 x 1200 Pixel;Bluetooth, WLAN;26.41 Zentimeter;4 GB;HUAWEI;7250 Milliamperestunden (mAh);-;-;-;MatePad;2020;2.27 GHz;HiSilicon;64 GB;802.11a/b/g/n/ac, 5 GHz Radiofrequenz, 2,4 GHz Radiofrequenz;Kraftvoller Sound immer und überall: Der Tablet-Computer ist mit einem Vier-Kanal und Vier-Lautsprecher-System von Harman Kardon ausgestattet und erzeugt einen kraftvollen Sound|Der große 7250 mAh-Akku bietet bis zu 12h lokale Videowiedergabe oder 7h 3D-Spielspaß mit 1080p der Akku kann in 30 Minuten auf 16 Prozent und innerhalb von 3,8 Stunden vollständig aufgeladen werden|Intelligente Anpassung von Kontrast, Helligkeit und Schärfe für ein komfortableres Leseerlebnis schont die Augen dank des TÜV Rheinland zertifizierten Low Blue Light Displays|Betriebsstyem EMUI 10 (auf Android 10) mit Huawei Mobile Services (HMS), ohne Google Play Store. Rückkamera: 8 MP, Frontkamera: 8 MP');
INSERT INTO `huawei-tablet` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Huawei-Tablet/Huawei MatePad 11 Grau.webp;', 'Huawei MatePad 11 Grau', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MToxNjY4NzA1NDI2NTY4ODU6MTY2NzY0NzM4MzpzcF9hdGY6MjAwNTAzMjQyNDU3OTg6OjA6Og&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FWineecy-Beleuchtete-Superleicht-Schutzh%25C3%25BClle-Magnetisch%2Fdp%2FB09XXKWBRN%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D37XP3N9O9KOFI%26keywords%3DHuawei%2BMatePad%2B11%2BGrau%26qid%3D1667647383%26qu%3DeyJxc2MiOiIxLjIxIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3D%252Caps%252C83%26sr%3D8-1-spons%26psc%3D1', '49,99', 5.0, 2, 2, 'Wineecy;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;-;【Kompatibilität】Speziell entwickelt für Huawei MatePad 11 Zoll DBY-W09 2021. NICHT geeignet für HUAWEI MatePad 10,4 Zoll 2020 Tablet und MatePad Pro 10,8 Zoll, bitte überprüfen Sie Ihr Gerät vor dem Kauf.|【Stability】3 Innenbeulen bieten verschiedene Blickwinkel des Tablet. Du könntest es beiläufig sogar auf dein Sofa legen. Das magnetische Innenleder bleibt die Tastatur adsorbiert, was überall auf Ihrer Urlaubs- oder Geschäftsreise für Stabilität sorgt.|【High-End-Material】Die Tastatur ist aus High-End-ABS-Material hergestellt. Keine billige Silikontastatur, die man ansonsten auf dem Markt findet. Ein Sprungmechanismus unter jeden Tasten ermöglicht eine taktile Rückmeldung bei jedem Tippen, und helfen Ihnen, schneller und fehlerfreier als auf einem Touchscreen zu schreiben.|【7 verschiedene Farben für die Hintergrundbeleuchtung】Eine Hintergrundbeleuchtung für Ihre Tastatur ist unerlässlich, aber warum sollten Sie sich nur auf eine Farbe beschränken? Sie 7 verschiedene Farben genießen und je nach Bedarf zwischen 3 Helligkeitsstufen einstellen. Die Reichweite von 10 m und die intelligente Identifizierung erhöhen den Reiz der Tastatur.|【Tastatur beleuchtet und wiederaufladbar und abnehmbar】bei der Bluetooth Tastatur ist 7-farbigen Beleuchtung verfügbar, 3 Helligkeit-Stufen lassen sich einstellen. Mit einer großen Kapazität von 450mAh ermöglicht die Tastatur eine Arbeitszeit bis zu 220 Stunden ohne Beleuchtung, 8 Stunden mit Beleuchtung.');
