INSERT INTO `huawei-tablet` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Huawei-Tablet/Huawei MatePad 11.webp;', 'Huawei MatePad 11', 'https://www.amazon.de/HUAWEI-FullView-Display-Lautsprecher-HarmonyOS-AppGallery/dp/B09FM3HCDF/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=25I1MDMDIX900&keywords=Huawei+MatePad+11&qid=1667647435&qu=eyJxc2MiOiIzLjQ3IiwicXNhIjoiMy4xMSIsInFzcCI6IjIuNDcifQ%3D%3D&sprefix=huawei+matep%2Caps%2C108&sr=8-3', '299,00', 4.3, 472, 0, 'HUAWEI;2;485 g;13 MP;13 MP;Ja;Integriert;Harmony OS 2.0;2560 x 1600 Pixel;Bluetooth, WLAN;10.95 Zoll;-;6 GB;HUAWEI;27.31 Wattstunden;-;2560 x 1600 Pixels;MatePad 11;2021;2.84 GHz;Qualcomm;64 GB;802.11a/b/g/n/ac, 5 GHz Radiofrequenz, 802.11ax, 2,4 GHz Radiofrequenz;【120 Hz Eye Comfort HUAWEI FullView-Display, DCI-P3 großer Farbraum】Das Display des HUAWEI MatePad 11 hat eine Bildwiederholrate von 120 Hz für ein flüssigeres visuelles Erlebnis. Und die DCI-P3-Farbskala macht die Farbdarstellung satter und lebendiger.|【4 Stereo-Lautsprecher】 Das Vier-Lautsprecher- und Vier-Kanal-Soundsystem schafft eine Welt des Klangs in Ihrer Hand. Die kraftvollen, wogenden Bässe und klaren, knackigen Obertöne sind von Harmon Kardon so abgestimmt, dass sie Ihre Lieblingsklänge so wiedergeben, wie sie zu hören sind.|【22,5 W Schnellladung und 12 Std. Videowiedergabe】 Dank der Technologie zur Anpassung der Bildwiederholrate ermöglicht der leistungsstarke Akku problemlos bis zu 12 Stunden entspanntes Arbeiten. Die Power reicht für ganze 12 Stunden Videowiedergabe, von der Abenddämmerung bis zum Morgengrauen. Durch die lange Akkulaufzeit bleibt der Spaß nie auf der Strecke – ob bei der Arbeit oder in der Freizeit.|【HUAWEI Share】Verbinden Sie Ihr Tablet mit Ihrem Laptop und arbeiten Sie an zwei Projekten gleichzeitig und ziehen Sie Dateien einfach per Drag-and-Drop zwischen den Bildschirmen hin und her. Alternativ können Sie Ihren Laptop-Bildschirm auf das MatePad spiegeln und den HUAWEI M-Pencil verwenden, um die volle kreative Kontrolle über Ihre Designprojekte zu erhalten.|【Multi-Window】Multiplizieren Sie Ihre Möglichkeiten mit der Multi-Window-Funktion des HUAWEI MatePad 11. Öffnen Sie bis zu 4 Apps auf einem einzigen Bildschirm und passen Sie die Art und Weise, wie Sie arbeiten und leben, einfach rundum an.');
